import React, {useEffect, useState} from "react";
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Calendar from './pages/Calendar.js';
import Sessions from './pages/Sessions.js';
import Timeslots from './pages/Timeslots.js';
import Speakers from './pages/Speakers.js';
import Rooms from './pages/Rooms.js';

const [items, setItems] = useState([]);
let name = "";

async function fetchData() {
    const items = await (await fetch("/all")).json();

    console.log(items);
    return items;
}

useEffect(() => {
    fetchData().then((data) => setItems(data));
}, items);

function App() {
  return (
    <>
     <div className="App">
            <header className="App-header">
                <div>
                    <label>
                        Name:
                        <input type="text" name="name" onChange={(val) => name = val.target.value}/>
                    </label>
                    <button onClick={async () => {await fetch("addTeammate", {
                        method: 'POST',
                        headers: {
                            'Accept': 'application/json',
                            'Content-Type': 'application/json',
                        },
                        body: name
                    });
                        fetchData().then((data) => setItems(data));}}>Add Teammate
                    </button>
                </div>
                <div>
                    Teammates:
                    {items
                        .filter((item) => item.hasOwnProperty("name"))
                        .map((item) => {
                            return <li>{item.name}</li>;
                        })}
                </div>
            </header>
        </div>
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact component={Calendar} />
          <Route path='/sessions' component={Sessions} />
          <Route path='/timeslots' component={Timeslots} />
          <Route path='/speakers' component={Speakers} />
          <Route path='/rooms' component={Rooms} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
